import React, {useState, createContext} from "react";
import {data} from "../data";
import CardInformation from "./CardInformation";
import RefreshButton from "./RefreshButton";

export const CitiesContent = createContext(undefined, undefined);

const Card = () => {
  const [cities] = useState(data);

  return (
    <CitiesContent.Provider value={cities}>
      <div>
        {cities.length ?
          <CardInformation/>
          :
          <RefreshButton/>
        }
      </div>
    </CitiesContent.Provider>

  );
};


export default Card;
